import React from 'react'

import TodoList from '../components/TodoList';

export default function TodoLists(){
    return (
        <React.Fragment style={styles.container}>
            <TodoList/>
        </React.Fragment>
    )
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
  });
